import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import DashboardLayout from './DashboardLayout';
import ProtectedRoute from './ProtectedRoute';
import CarCard from './CarCard';
import Profile from './Profile';
import Favorites from './Favorites';
import Map from './Map';
import Settings from './Settings';
import CarDetails from './CarDetails';
import Login from './Login';
import Signup from './Signup';

const cars = [
  { id: 1, image: 'https://via.placeholder.com/1920x1080?text=Lamborghini+Huracan', make: 'Lamborghini', model: 'Huracan', year: 2023, price: 250000, condition: 'New', description: 'A high-performance supercar with stunning design and exhilarating speed.' },
  { id: 2, image: 'https://via.placeholder.com/1920x1080?text=Ferrari+488+Spider', make: 'Ferrari', model: '488 Spider', year: 2022, price: 330000, condition: 'New', description: 'Convertible supercar with a V8 engine delivering unmatched power.' },
  { id: 3, image: 'https://via.placeholder.com/1920x1080?text=Porsche+911+Turbo+S', make: 'Porsche', model: '911 Turbo S', year: 2021, price: 220000, condition: 'Excellent', description: 'Iconic sports car with turbocharged engine and precision handling.' },
  { id: 4, image: 'https://via.placeholder.com/1920x1080?text=Bentley+Continental+GT', make: 'Bentley', model: 'Continental GT', year: 2020, price: 230000, condition: 'Used', description: 'Luxury grand tourer combining elegance with powerful performance.' },
  { id: 5, image: 'https://via.placeholder.com/1920x1080?text=McLaren+720S', make: 'McLaren', model: '720S', year: 2023, price: 300000, condition: 'New', description: 'Aerodynamic supercar with carbon fiber construction and blistering speed.' },
  { id: 6, image: 'https://via.placeholder.com/1920x1080?text=Aston+Martin+Vantage', make: 'Aston Martin', model: 'Vantage', year: 2022, price: 180000, condition: 'New', description: 'British sports car with a roaring V8 and timeless design.' },
  { id: 7, image: 'https://via.placeholder.com/1920x1080?text=Rolls-Royce+Ghost', make: 'Rolls-Royce', model: 'Ghost', year: 2021, price: 315000, condition: 'Excellent', description: 'Ultra-luxury sedan offering unparalleled comfort and prestige.' },
  { id: 8, image: 'https://via.placeholder.com/1920x1080?text=Bugatti+Chiron', make: 'Bugatti', model: 'Chiron', year: 2023, price: 3000000, condition: 'New', description: 'The ultimate hypercar with quad-turbo W-16 engine and record-breaking speed.' },
  { id: 9, image: 'https://via.placeholder.com/1920x1080?text=Lamborghini+Aventador', make: 'Lamborghini', model: 'Aventador', year: 2020, price: 400000, condition: 'Used', description: 'Aggressive supercar with scissor doors and monstrous V12 power.' },
  { id: 10, image: 'https://via.placeholder.com/1920x1080?text=Ferrari+LaFerrari', make: 'Ferrari', model: 'LaFerrari', year: 2019, price: 1400000, condition: 'Used', description: 'Hybrid hypercar blending electric and V12 technology for supreme performance.' },
  { id: 11, image: 'https://via.placeholder.com/1920x1080?text=Porsche+918+Spyder', make: 'Porsche', model: '918 Spyder', year: 2018, price: 850000, condition: 'Used', description: 'Plug-in hybrid supercar with race-car derived technology.' },
  { id: 12, image: 'https://via.placeholder.com/1920x1080?text=McLaren+P1', make: 'McLaren', model: 'P1', year: 2017, price: 1150000, condition: 'Used', description: 'Revolutionary hybrid hypercar with instant torque and aerodynamic efficiency.' }
];

function Dashboard() {
  const [displayedCars, setDisplayedCars] = useState([]);
  const [hasMore, setHasMore] = useState(true);
  const [loading, setLoading] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [conditionFilter, setConditionFilter] = useState('');

  const carsPerLoad = 6;
  const [loadedCount, setLoadedCount] = useState(0);

  useEffect(() => {
    loadMoreCars();
  }, []);

  useEffect(() => {
    const handleScroll = () => {
      if (window.innerHeight + document.documentElement.scrollTop !== document.documentElement.offsetHeight || loading || !hasMore) return;
      loadMoreCars();
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, [loading, hasMore]);

  const loadMoreCars = () => {
    if (loading || !hasMore) return;

    setLoading(true);

    const filteredCars = cars.filter(car => {
      const matchesSearch = car.make.toLowerCase().includes(searchTerm.toLowerCase()) ||
                           car.model.toLowerCase().includes(searchTerm.toLowerCase()) ||
                           car.year.toString().includes(searchTerm);
      const matchesCondition = !conditionFilter || car.condition === conditionFilter;
      return matchesSearch && matchesCondition;
    });

    const nextCars = filteredCars.slice(loadedCount, loadedCount + carsPerLoad);
    setDisplayedCars(prev => [...prev, ...nextCars]);
    setLoadedCount(prev => prev + nextCars.length);
    setHasMore(loadedCount + nextCars.length < filteredCars.length);
    setLoading(false);
  };

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
    resetAndReload();
  };

  const handleConditionChange = (e) => {
    setConditionFilter(e.target.value);
    resetAndReload();
  };

  const resetAndReload = () => {
    setDisplayedCars([]);
    setLoadedCount(0);
    setHasMore(true);
    setLoading(false);
  };

  useEffect(() => {
    resetAndReload();
  }, [searchTerm, conditionFilter]);

  return (
    <div>
      <h1 className="text-3xl font-bold mb-4">Luxury & Sports Car Gallery</h1>
      <div className="mb-6">
        <input
          type="text"
          placeholder="Search by make, model, or year..."
          value={searchTerm}
          onChange={handleSearchChange}
          className="w-full p-2 border border-gray-300 rounded mb-2"
        />
        <select
          value={conditionFilter}
          onChange={handleConditionChange}
          className="p-2 border border-gray-300 rounded"
        >
          <option value="">All Conditions</option>
          <option value="New">New</option>
          <option value="Used">Used</option>
          <option value="Excellent">Excellent</option>
          <option value="Good">Good</option>
        </select>
      </div>
      <div id="car-grid" className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {displayedCars.map(car => <CarCard key={car.id} car={car} />)}
      </div>
      {loading && <div className="text-center py-4">Loading more cars...</div>}
      {!hasMore && displayedCars.length > 0 && <div className="text-center py-4">No more cars to load.</div>}
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/dashboard" replace />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={
          <ProtectedRoute>
            <DashboardLayout>
              <Dashboard />
            </DashboardLayout>
          </ProtectedRoute>
        } />
        <Route path="/profile" element={
          <ProtectedRoute>
            <DashboardLayout>
              <Profile />
            </DashboardLayout>
          </ProtectedRoute>
        } />
        <Route path="/favorites" element={
          <ProtectedRoute>
            <DashboardLayout>
              <Favorites />
            </DashboardLayout>
          </ProtectedRoute>
        } />
        <Route path="/map" element={
          <ProtectedRoute>
            <DashboardLayout>
              <Map />
            </DashboardLayout>
          </ProtectedRoute>
        } />
        <Route path="/settings" element={
          <ProtectedRoute>
            <DashboardLayout>
              <Settings />
            </DashboardLayout>
          </ProtectedRoute>
        } />
        <Route path="/car/:id" element={
          <ProtectedRoute>
            <DashboardLayout>
              <CarDetails />
            </DashboardLayout>
          </ProtectedRoute>
        } />
      </Routes>
    </Router>
  );
}

export default App;
